import React from 'react';
import Logo from './logomain.png'

export default function Form() {
    return (
        <div>
            <div className = "NavBar">
                <a><img className = "logo" src={Logo} /></a>
            </div>
            <div>
            <input type="text" placeholder="Название " className = "search" />
                <a href="../indexsecond.js" class="button b-green">Отправить проект</a>
            </div>
        </div>
    );
}
